import React, {useContext, useState, useEffect} from "react";
import classes from './RightNav.module.css';
import { Doctor, HospitalData, ClinicData, LabData } from "../../../StateData/NavData/NavData";
import NavigationItem from "../../NavigationItems/NavigationItem/NavigationItem";
import context from "../../../Context/Context";
import {Link} from 'react-router-dom';

const RightNav = (props) => {

    const [index, setIndex] = useState(0);
    console.log('Inside RightNav', props.name);
    // const [docImgArr,setDocImgArr]  = useState(['Karachi', 'Lahore', 'Islamabad', 'Quetta', 'Peshawar']);
    const [docImgArr,setDocImgArr]  = useState([
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
        'data:image/jpeg;base64,',
    ]);
    // const [hosImgArr,setHosImgArr]  = useState(['Specialization', 'Conditions', 'Treatment', 'Online']);
    const [hosImgArr,setHosImgArr]  = useState(
        ['data:image/jpeg;base64,',  
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,',
    'data:image/jpeg;base64,'
]);
    const {itemIndex, rightItemIndex} = useContext(context);
    const [output, setOutput] = useState({});

    // console.log('Inside RightNav', itemIndex);

    // console.log('Inside RightNav', rightItemIndex);

    useEffect(() => {
        setIndex(itemIndex);

        if (props.name === 'Doctor') {
            console.log('Inside IF');
            setOutput(Doctor[itemIndex]);
        } else if (props.name === 'Hospital') {
            setOutput(HospitalData[itemIndex]);
        }
        else if (props.name === 'Clinic') {
            setOutput(ClinicData[itemIndex]);
        }
        else if (props.name === 'Laboratory') {
            setOutput(LabData[itemIndex]);
        }

    }, [props.name, itemIndex, output, docImgArr, hosImgArr]);

    // console.log(docImgArr)
    // console.log("host img",hosImgArr[0])
    // console.log(output)

    return(

        <div className={classes.RightNav} style={
            props.name === 'Hospital' || props.name === 'Clinic' || props.name === 'Laboratory'  ? index ? {
            backgroundImage: `url(${docImgArr[index]})`
          } : {
            backgroundImage: `url(${docImgArr[0]})`

          }
        
          : props.name === 'Doctor' && index ? {
            backgroundImage: `url(${hosImgArr[index]})`
          } : {
            backgroundImage: `url(${hosImgArr[0]})`}

        }>
            {console.log(index)}
            {/* <img src={hosImgArr[index]}/> */}
                {output && 
                    <div className={classes.List} >
                        <ul>
                            { output[Object.keys(output)[0]] &&
                            
                                output[Object.keys(output)[0]].map((item, i)=>(

                                    <NavigationItem 
                                            key={item+i} 
                                            link={'./'} 
                                            class={classes.NavigationItem}
                                            isHover={false}
                                            def={i}
                                            rightItemName ={item}
                                            isRight = {true}
                                            itemIndex={itemIndex}
                                            toolbarName = {props.name}
                                            icon={props.name == 'Doctor' }
                                            closeHandler= {props.closeHandler}
                                    >
                                            {item}

                                    </NavigationItem>
                                ))
                            }

                        </ul>
                    </div>
                
                }
                
                { output &&
                    <div className={classes.ViewAll}>
                <Link to={`/CompleteList/${props.name}/${Object.keys(output)[0]}`} onClick={props.closeHandler} >
                    <button data-text="Awesome" className={classes.Button}>
                        <span className={classes.ActualText}>&nbsp;View All&nbsp;</span>
                        <span className={classes.HoverText} aria-hidden="true">&nbsp;View&nbsp;All&nbsp;</span>
                    </button>
                </Link>
                
                </div>
                }
        </div>
    );
}

export default RightNav;